templateHistory.lhs:
${#concat(
    ?{rawdmg:'Damage'[number]|0'}
    ?{armor:'Armor'[number]|Calc_Armor_Nmr'}
)}$
<table>
    <tr>
        <th>Damage Taken</th>
        <th>${dmg:= rawdmg}$</th>
    </tr>
    <tr>
        <th>Evasion Damage</th>
        <th>${edmg:= min(NPC_Evasion_Nmr, dmg)}$</th>
        ${#setPropertyInEntity('self', 'NPC_Evasion_Nmr', 'NPC_Evasion_Nmr - edmg')}$
    </tr>
    <tr>
		${#nonedmg:= dmg - edmg}$
        <th>Health Damage</th>
        <th>${hdmg:= nonedmg == 0 ? 0 : max(1, nonedmg - armor)}$</th>
        ${#gate:= NPC_Current_Health_Nmr <= hdmg}$
        ${#setPropertyInEntity('self', 'NPC_Current_Health_Nmr', 'gate ? NPC_Max_Health_Nmr : NPC_Current_Health_Nmr - hdmg')}$
    </tr>
</table>
${!gate ? "<div class='dice-roll'><div class='dice-result'><h4 class='dice-total'>GATE PASSED</h4></div></div>" : ""}$
${#dead:= gate ? NPC_Health_Gate_Nmr == 0 : false}$
${#setPropertyInEntity('self', 'NPC_Health_Gate_Nmr', 'gate ? max(0, NPC_Health_Gate_Nmr - 1) : NPC_Health_Gate_Nmr')}$
${!dead ? "<div class='dice-roll'><div class='dice-result'><h4 class='dice-total'>TAKEN OUT</h4></div></div>" : ""}$
${#%{
    let em = game.modules.get("effectmacro");
    let char = game.actors.get("wXhOpQ0rdC4URB6Y"); console.log(entity);
    if (localVars.gate && entity.system.props.Ramps_Tension && em && char && char.effects.contents[0])
    {
        em.api.callMacro(char.effects.contents[0], "never");
    }
}%}$
